@americareform i suffer from anxiety too among many other conditions.    . add adhd bipolar , ptsd my ❤ goes out to you. 
i was diagnosed late at 10yrs old. 
god bless

@mattravis i feel it.  i am always happy to see others talk about it. especially men.

i have bipolar disorder. 

was weird feeling ashamed of that fact when i was first diagnosed in high school.  i used to say i am bipolar.  but that is not who i am.  just something i deal with.

@patterson087 2. had lunch with an acquaintance diagnosed with schizophrenia. he's well. lovely person and great conversation.

lots of people with bipolar depression who achieve great things.

over 10% of us have a history of depression, and some have even attempted suicide...

@mommyof3lal 
1/. hi shawna. from someone who tried to complete suicide and have battled depression and bipolar (diagnosed after attempt) all my life, i would love to give you a huge hug right now. i need to let you affirm somethings...
- depression is an illness that numbs...

@elle_desylva good point! i have agoraphobia followed with an anxiety disorder. a couple years ago i was also diagnosed with bipolar disorder.

another doctor later said she thought i was misdiagnosed &amp; thought i had add. 

all of this and yet i don't want to get out there and massacre ppl!

@suzybluelady @bannerite it's a distraction.
those diagnosed with #mentalillness are responsible for only 5-10% of violent death of others. much more likely to kill themselves, especially if a gun is available.

- bipolar, lead support groups for individuals suffering and their families

@dr_lovelee dr amanda peta (psychologist) and dr aa motojesi (psychiatrist) 

both based at louis pasteur hospital in pretoria. i was 18 when i first met them. they diagnosed me with severe depression and bipolar disorder. they have helped me in so many ways. 

do check them out

