@joharyspark @bianconeri541 @voksul @evanaugustpdx @againchoke @davidafrench • cost of meds is crippling. 

by example • my ex • hourly wage earner • diagnosed as depressed / bipolar years ago. with insurance &amp; discounts meds are $300 / mo. some months can't afford and she crashes. 

continued

@auraleeharvey @jenkirkman https://t.co/reazmhvoio

so no, depression is actually severely under-diagnosed. i'm sorry that you personally had a negative experience with whatever medication you might have taken, but meds save lives. 

and yeah, as a person with bipolar and anxiety, i do fucking care.

@rcmentalhealth wondering if there’s any representation from anyone with #bipolar offering their perspective in any of the hearings?

and wondering if this is of interest? there’s nothing like this in melbourne unyet so many diagnosed may benefit 🤷‍♂️.

https://t.co/tpz21p90am https://t.co/0kt4p0so37

@samdylanfinch i was diagnosed with adhd as a kid, bipolar manic depression as a teen

it took my case worker and therapist in a homeless shelter to have me tested again, and bpd, dissociation and depersonalization issues, and ptsd. i also still have the manic depression diagnosis. 

they-

hey everyone, my latest guest post in my mental illness series is live!

@disableddisney shares her story of being incorrectly diagnosed as bipolar and how that misdiagnosis affected her life. check out her beautiful piece below!
https://t.co/flvpioxoo7

@dmataconis the other point that is not talked about is people diagnosed w/ a mental illness have their diagnoses changed all the time.

ie diagnosing bipolar from depression can be tricky especially if there is no family history of bp or no manic episode.

i’m just saying it’s complicated.

re manic depression (aka bipolar);
after 40+ years of highs &amp; lows, diagnosed  2003...

then the mania ebbs. the extravagant high descends into a profound low. while this volatility is horribly painful, it can... https://t.co/5mfqeo23t2

